(158,	1,	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'<!-- wp:fl-builder/layout -->\n<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/ground-burial.jpg\" alt=\"Ground Burial\" itemprop=\"image\" height=\"540\" width=\"720\" title=\"ground-burial\">\n		<h3>Full Burial</h3>		\n			<p>Ground burial is offered in various sections at Rose Hill Memorial Park.&nbsp;&nbsp;Please contact us regarding sections available for pre-planning and immediate need. Inquiry about specific locations is best made by family members at the cemetery office.</p>\nSection 32 is our current full burial section with lots available.<br>\n<a href=\"https://rosehillmemorialpark.com/rose-hill-map/\">See map</a>.\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/cremated-remains-burial.jpg\" alt=\"Burial of cremated remains\" itemprop=\"image\" height=\"540\" width=\"720\" title=\"cremated-remains-burial\">\n		<h3>Cremation Burial</h3>		\n			<p>Rose Hill Memorial Park&nbsp;offers a variety of options for the respectful disposition and memorialization of cremated remains.&nbsp; Please inquire with our office for specific information.</p>\n<p>Section 16-B is our current cremation section with lots only available for cremains. This is a new section that was recently opened.</p>\n<p><a href=\"https://rosehillmemorialpark.com/rose-hill-map/\">See map</a>.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/ground-burial.jpg\" alt=\"Ground Burial\" itemprop=\"image\" height=\"540\" width=\"720\" title=\"ground-burial\">\n		<h3>Crypt Burial</h3>		\n			<p>Section 23-C is our crypt section, which are double depth lots with two full burial spaces in the same gravesite. There is limited space in this section.</p>\n<p><a href=\"https://rosehillmemorialpark.com/rose-hill-map/\">See map</a>.</p>\n<!-- /wp:fl-builder/layout -->',	'Services',	'',	'publish',	'closed',	'closed',	'',	'services',	'',	'',	'2019-05-17 11:53:07',	'2019-05-17 15:5