(418,	1,	'2018-03-13 14:03:52',	'2018-03-13 18:03:52',	'\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2017/04/about-us-1.jpg\" alt=\"about-us-1\" itemprop=\"image\" height=\"1590\" width=\"1920\"  />\n	<h3>History &amp; Staff</h3>\n<p>We have years of experience caring for families, from all walks of life. Each family comes to us because they know we are leaders in our profession, dedicated to excellence in service, and have the highest integrity.</p>\n<p>We invite you to discover who has made Rose Hill Funeral Homes the ultimate provider of creating healing experiences in the community. This section contains the heritage, vision, and the people behind Rose Hill Memorial Park\'s reputation of quality, sincerity, and trust.</p>\n	<h3 style=\"text-align: center;\">Meet the Team</h3>\n<p style=\"text-align: center;\">Write something about the people who make your business go or your philosophy behind customer service.<br />\nWhy? Because people want to know who they\'re doing business with. It\'s a human thing.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-1-square.jpg\" alt=\"about-us-headshot-1\" itemprop=\"image\" height=\"800\" width=\"800\"  />\n<h3>Regan McCook</h3>		\n			<p style=\"text-align: center;\"><em>Founder &amp; CEO</em></p>\n	<p style=\"text-align: center;\">Include a short bio with an interesting fact about the person.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-2-square.jpg\" alt=\"about-us-headshot-2\" itemprop=\"image\" height=\"800\" width=\"800\"  />\n<h3>Eric Teagan</h3>		\n			<p style=\"text-align: center;\"><em>Vice President</em></p>\n	<p style=\"text-align: center;\">Include a short bio with an interesting fact about the person.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-3-square.jpg\" alt=\"about-us-headshot-3\" itemprop=\"image\" height=\"800\" width=\"800\"  />\n<h3>Timothy Barrett</h3>		\n			<p style=\"text-align: center;\"><em>CFO</em></p>\n	<p style=\"text-align: center;\">Include a short bio with an interesting fact about the person.</p>\n		<h3>Next Steps...</h3>\n		<p>This is should be a prospective customer\'s number one call to action, e.g., requesting a quote or perusing your product catalog.</p>\n			<a href=\"\" target=\"_self\" role=\"button\">\n							Call to Action\n					</a>\n',	'About Us',	'',	'inherit',	'closed',	'closed',	'',	'2-revision-v1',	'',	'',	'2018-03-13 14:03:52',	'2018-03-13 18:03:52',	'',	2,	'https://rosehillmemorialpark.com/2-revision-v1/',	0,	'revision',	'',	0),
