(299,	1,	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'What goes into a blog post? Helpful, industry-specific content that: 1) gives readers a useful takeaway, and 2) shows you\'re an industry expert. \r\n\r\nUse your company\'s blog posts to opine on current industry topics, humanize your company, and show how your products and services can help people.',	'Blog Post Title',	'',	'inherit',	'closed',	'closed',	'',	'1-revision-v1',	'',	'',	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'',	1,	'https://rosehillmemorialpark.com/1-revision-v1/',	0,	'revision',	'',	0),
(300,	1,	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2017/04/about-us-1.jpg\" alt=\"about-us-1\" itemprop=\"image\"  />\n	<h3>Our Approach</h3>\n<p>You could also call this heading \"Our philosophy\" or \"Our vision.\" This is the place to talk about what drives you and your business and what\'s unique about your process. What you write here should be something distinct and interesting about your business that sets it apart from others in the same industry.</p>\n	<h3>Our Story</h3>\n<p>Every business has a beginning, and this is where you talk about yours. People want to know what opportunity you saw or how your passion led to the creation of something new. Talk about your roots--people wanna know you have some.</p>\n	<h3 style=\"text-align: center;\">Meet the Team</h3>\n<p style=\"text-align: center;\">Write something about the people who make your business go or your philosophy behind customer service.<br />\nWhy? Because people want to know who they\'re doing business with. It\'s a human thing.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-1-square.jpg\" alt=\"about-us-headshot-1\" itemprop=\"image\"  />\n	<h3>Regan McCook</h3>		\n			<p style=\"text-align: center;\"><em>Founder &amp; CEO</em></p>\n	<p style=\"text-align: center;\">Include a short bio with an interesting fact about the person.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-2-square.jpg\" alt=\"about-us-headshot-2\" itemprop=\"image\"  />\n	<h3>Eric Teagan</h3>		\n			<p style=\"text-align: center;\"><em>Vice President</em></p>\n	<p style=\"text-align: center;\">Include a short bio with an interesting fact about the person.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-3-square.jpg\" alt=\"about-us-headshot-3\" itemprop=\"image\"  />\n	<h3>Timothy Barrett</h3>		\n			<p style=\"text-align: center;\"><em>CFO</em></p>\n	<p style=\"text-align: center;\">Include a short bio with an interesting fact about the person.</p>\n		<h3>Next Steps...</h3>\n		<p>This is should be a prospective customer\'s number one call to action, e.g., requesting a quote or perusing your product catalog.</p>\n			<a href=\"\" target=\"_self\" role=\"button\">\n							Call to Action\n					</a>\n',	'About Us',	'',	'inherit',	'closed',	'closed',	'',	'2-revision-v1',	'',	'',	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'',	2,	'https://rosehillmemorialpark.com/2-revision-v1/',	0,	'revision',	'',	0),
(301,	1,	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'\n	<p>Get in touch and we\'ll get back to you as soon as we can.  We look forward to hearing from you!</p>\n	<p>[ninja_forms id=1]</p>\n',	'Contact Us',	'',	'inherit',	'closed',	'closed',	'',	'19-revision-v1',	'',	'',	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'',	19,	'https://rosehillmemorialpark.com/19-revision-v1/',	0,	'revision',	'',	0),
(302,	1,	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'				<a href=\"#\" target=\"_self\" itemprop=\"url\">\r\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2017/04/home-1.jpg\" alt=\"home-1\" itemprop=\"image\"  />\r\n				</a>\r\n	<h3><a href=\"#\" target=\"_self\">Product / Service #1</a></h3>		\r\n			<p>Whatever your company is most known for should go right here, whether that\'s bratwurst or baseball caps or vampire bat removal.</p><a href=\"#\" target=\"_self\">Learn More</a>		 \r\n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\r\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2017/04/home-2.jpg\" alt=\"home-2\" itemprop=\"image\"  />\r\n				</a>\r\n	<h3><a href=\"#\" target=\"_self\">Product / Service #2</a></h3>		\r\n			<p>What\'s another popular item you have for sale or trade? Talk about it here in glowing, memorable terms so site visitors have to have it.</p><a href=\"#\" target=\"_self\">Learn More</a>		 \r\n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\r\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2017/04/home-3.jpg\" alt=\"home-3\" itemprop=\"image\"  />\r\n				</a>\r\n	<h3><a href=\"#\" target=\"_self\">Product / Service #3</a></h3>		\r\n			<p>Don\'t think of this product or service as your third favorite, think of it as the bronze medalist in an Olympic medals sweep of great products/services.</p><a href=\"#\" target=\"_self\">Learn More</a>		 \r\n	<h3>Your Main Message</h3>\r\n<p>Use this space to tell people what your company does and why and how it does it. What\'re you known for? Who likes you? What\'s your number one competitive advantage?</p>\r\n<p>Include all the things that make your business unique and better than the competition. Do you have a patented 13-step process for taxidermy that results in the most lifelike stuffed owls? You gotta mention that.</p>\r\n<p>Other good things to weave into this copy include: awards won, distinctions given, number of products sold, company philosophy (just keep it short), interesting company history bits, and anything that makes a reader think you\'d be awesome to do business with.</p>\r\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2017/04/home-4.jpg\" alt=\"home-4\" itemprop=\"image\"  />\r\n		<h3>Next Steps...</h3>\r\n		<p>This is should be a prospective customer\'s number one call to action, e.g., requesting a quote or perusing your product catalog.</p>\r\n	<a href=\"\" target=\"_self\" role=\"button\">\r\n						Call to Action\r\n					</a>\r\n',	'Home',	'',	'inherit',	'closed',	'closed',	'',	'156-revision-v1',	'',	'',	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'',	156,	'https://rosehillmemorialpark.com/156-revision-v1/',	0,	'revision',	'',	0),
(303,	1,	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'\n		<h3>Product / Service #1</h3>		\n			Whatever your company is most known for should go right here, whether that\'s bratwurst or baseball caps or vampire bat removal.		 \n		<h3>Product / Service #2</h3>		\n			What\'s another popular item you have for sale or trade? Talk about it here in glowing, memorable terms so site visitors have to have it.		 \n		<h3>Product / Service #3</h3>		\n			Don\'t think of this product or service as your third favorite, think of it as the bronze medalist in an Olympic medals sweep of great products/services.		 \n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2017/04/services-1.jpg\" alt=\"services-1\" itemprop=\"image\"  />\n		<h3>Talk more about your products here.</h3>		\n			<p>Tell prospective customers more about your company and the services you offer here.  Replace this image with one more fitting to your business.</p>		 \n		<h3>Talk more about your products here.</h3>		\n			<p>Tell prospective customers more about your company and the services you offer here.  Replace this image with one more fitting to your business.</p>		 \n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2017/04/services-2.jpg\" alt=\"services-2\" itemprop=\"image\"  />\n		<h3>Next Steps...</h3>\n		<p>This is should be a prospective customer\'s number one call to action, e.g., requesting a quote or perusing your product catalog.</p>\n	<a href=\"\" target=\"_self\" role=\"button\">\n						Call to Action\n					</a>\n',	'Services',	'',	'inherit',	'closed',	'closed',	'',	'158-revision-v1',	'',	'',	'2018-01-26 14:12:15',	'2018-01-26 19:12:15',	'',	158,	'https://rosehillmemorialpark.com/158-revision-v1/',	0,	'revision',	'',	0),
