(504,	1,	'2018-04-06 14:42:47',	'2018-04-06 18:42:47',	'\n		<h3>Search for a loved one</h3>\n		<p>Use our online search to locate the grave location in our park.</p>\n			<a href=\"\" target=\"_self\" role=\"button\">\n							Click Here\n					</a>\n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-3.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"719\" width=\"1080\"  />\n				</a>\n<h3><a href=\"#\" target=\"_self\">Rose Hill Memorial Park</a></h3>		\n			<p>Whatever your company is most known for should go right here, whether that\'s bratwurst or baseball caps or vampire bat removal.</p>\n<a href=\"#\" target=\"_self\">Learn More</a>		 \n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-2.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"719\" width=\"1080\"  />\n				</a>\n<h3><a href=\"#\" target=\"_self\">Welcome</a></h3>		\n			<p>What\'s another popular item you have for sale or trade? Talk about it here in glowing, memorable terms so site visitors have to have it.</p>\n<a href=\"#\" target=\"_self\">Learn More</a>		 \n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-1.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"719\" width=\"1080\"  />\n				</a>\n<h3><a href=\"#\" target=\"_self\">Memorial Park Info</a></h3>		\n			<p>Don\'t think of this product or service as your third favorite, think of it as the bronze medalist in an Olympic medals sweep of great products/services.</p>\n<a href=\"#\" target=\"_self\">Learn More</a>		 \n	<h3>Your Main Message</h3>\n<p>Use this space to tell people what your company does and why and how it does it. What\'re you known for? Who likes you? What\'s your number one competitive advantage?</p>\n<p>Include all the things that make your business unique and better than the competition. Do you have a patented 13-step process for taxidermy that results in the most lifelike stuffed owls? You gotta mention that.</p>\n<p>Other good things to weave into this copy include: awards won, distinctions given, number of products sold, company philosophy (just keep it short), interesting company history bits, and anything that makes a reader think you\'d be awesome to do business with.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-4.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"1188\" width=\"948\"  />\n		<h3>Next Steps...</h3>\n		<p>This is should be a prospective customer\'s number one call to action, e.g., requesting a quote or perusing your product catalog.</p>\n			<a href=\"\" target=\"_self\" role=\"button\">\n							Call to Action\n					</a>\n',	'Home',	'',	'inherit',	'closed',	'closed',	'',	'156-revision-v1',	'',	'',	'2018-04-06 14:42:47',	'2018-04-06 18:42:47',	'',	156,	'https://rosehillmemorialpark.com/156-revision-v1/',	0,	'revision',	'',	0),
(353,	1,	'2018-02-28 15:21:55',	'2018-02-28 20:21:55',	'<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2017/04/about-us-1.jpg\" alt=\"about-us-1\" />\r\n<h3>Our Approach</h3>\r\nYou could also call this heading \"Our philosophy\" or \"Our vision.\" This is the place to talk about what drives you and your business and what\'s unique about your process. What you write here should be something distinct and interesting about your business that sets it apart from others in the same industry.\r\n<h3>Our Story</h3>\r\nEvery business has a beginning, and this is where you talk about yours. People want to know what opportunity you saw or how your passion led to the creation of something new. Talk about your roots--people wanna know you have some.\r\n<h3 style=\"text-align: center;\">Meet the Team</h3>\r\n<p style=\"text-align: center;\">Write something about the people who make your business go or your philosophy behind customer service.\r\nWhy? Because people want to know who they\'re doing business with. It\'s a human thing.</p>\r\n<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-1-square.jpg\" alt=\"about-us-headshot-1\" />\r\n<h3>Regan McCook</h3>\r\n<p style=\"text-align: center;\"><em>Founder &amp; CEO</em></p>\r\n<p style=\"text-align: center;\">Include a short bio with an interesting fact about the person.</p>\r\n<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-2-square.jpg\" alt=\"about-us-headshot-2\" />\r\n<h3>Eric Teagan</h3>\r\n<p style=\"text-align: center;\"><em>Vice President</em></p>\r\n<p style=\"text-align: center;\">Include a short bio with an interesting fact about the person.</p>\r\n<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-3-square.jpg\" alt=\"about-us-headshot-3\" />\r\n<h3>Timothy Barrett</h3>\r\n<p style=\"text-align: center;\"><em>CFO</em></p>\r\n<p style=\"text-align: center;\">Include a short bio with an interesting fact about the person.</p>\r\n\r\n<h3>Next Steps...</h3>\r\nThis is should be a prospective customer\'s number one call to action, e.g., requesting a quote or perusing your product catalog.\r\n\r\n<a role=\"button\" target=\"_self\">\r\nCall to Action\r\n</a>',	'About Us',	'',	'inherit',	'closed',	'closed',	'',	'2-autosave-v1',	'',	'',	'2018-02-28 15:21:55',	'2018-02-28 20:21:55',	'',	2,	'https://rosehillmemorialpark.com/2-autosave-v1/',	0,	'revision',	'',	0),
