(629,	1,	'2018-05-24 12:35:27',	'2018-05-24 16:35:27',	'<!-- wp:fl-builder/layout -->\n	<p>Rose Hill Memorial Park offers a new way to help commemorate  the deceased. Our online memorial tribute allows family and friends to post photos, documents, memoirs, and videos that best represent your loved one.</p>\n<p>Up to 10 MB of data can be uploaded per form submission in the form of PDF, JPG, JPEG, GIF, PNG, MP3, MPG, or MP4.</p>\n<p>All files will be reviewed by Rose Hill administration prior to posting online.</p>\n	<h3>Memories of Your Loved Ones</h3>\n<p></p>\n<font face=\"Verdana\" size=\"2\" color=\"#000000\">Powered by</font><img src=\"//assets.emailmeform.com/images/footer-logo.png?bWFzdGVy\" /><font face=\"Verdana\" size=\"2\" color=\"#000000\">EMF </font><a href=\"https://www.emailmeform.com/\" target=\"_blank\" rel=\"noopener noreferrer\"><font face=\"Verdana\" size=\"2\" color=\"#000000\">Contact Form</font></a>\n	<h3>Last Supper Monument Restoration</h3>\n<p>The Last Supper was originally painted by Leonardo DaVinci as his conception of Christ\'s life.  The monument at Rose Hill Memorial Park was created out of one single piece of marble and it took four years to create. The panel is 28 feet by 9 by 6 .  It was carved in Italy by the Pomeian Studios.</p>\n<p>Your donation will be considered a restricted gift for use by Rose Hill Memorial Park to restore the Last Supper. All donations are tax deductible. Your receipt is your proof of your donation.   This is a not-for-profit, as designated by the IRS under Code Section 501(c)13.</p>\n<p>Thank you for your donation to this important project.</p>\n	<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\" target=\"_top\">\n<input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\" />\n<input type=\"hidden\" name=\"hosted_button_id\" value=\"92LBM5T8W88HN\" />\n<input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_donateCC_LG.gif\" border=\"0\" name=\"submit\" title=\"PayPal - The safer, easier way to pay online!\" alt=\"Donate with PayPal button\" />\n<img alt=\"\" border=\"0\" src=\"https://www.paypal.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\" />\n</form>\n<!-- /wp:fl-builder/layout -->',	'Memories',	'',	'publish',	'closed',	'closed',	'',	'memories',	'',	'',	'2019-05-06 15:25:26',	'2019-05-06 19:25:26',	'',	0,	'https://rosehillmemorialpark.com/?page_id=629',	0,	'page',	'',	0),
