(539,	1,	'2018-04-16 10:00:11',	'2018-04-16 14:00:11',	'<!-- wp:fl-builder/layout -->\n<p>Rose Hill Memorial Park is divided into 32 sections which include full burial and cremation burial. Section 11 is our \"Pathway of Heroes\" specifically to honor fallen veterans. Please contact us to discuss your burial needs or if you need assistance locating the grave of a loved one.</p>\n<p>&nbsp;</p>\n		<h3>Birds Eye View</h3>\n		<p>We take great pride in the beauty and park-like setting of Rose Hill Memorial Park.&nbsp; View the many sections of Rose Hill from above.</p>\n			<a href=\"https://rosehillmemorialpark.com/aerial-photos\" target=\"_self\" role=\"button\" rel=\"noopener noreferrer\">\n						View Aerial Photos\n					</a>\n	<p><strong>Click on the images below for a larger view of each section with plot numbers.</strong></p>\n<!-- /wp:fl-builder/layout -->',	'Rose Hill Map',	'',	'publish',	'closed',	'closed',	'',	'rose-hill-map',	'',	'',	'2019-05-17 11:39:03',	'2019-05-17 15:39:03',	'',	0,	'https://rosehillmemorialpark.com/?page_id=539',	0,	'page',	'',	0),
