(599,	1,	'2018-04-16 12:12:46',	'2018-04-16 16:12:46',	'\n	<p><img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/rose-hill-memorial-park1-1024x768.jpg\" alt=\"Rose Hill Memorial Park\" width=\"518\" height=\"381\" />Rose Hill is a place of remembrance and respect. We strive to keep a beautiful, park like atmosphere and encourage visits from family and friends.  We honor the custom of expressing love and devotion by decorating graves where loved ones are buried. Common practice is to adorn burial spaces with flowers. Decorating, however, must be done in a way that does not create a safety hazard, impede proper maintenance, infringe on other graves, diminish the character of the cemetery, or offend others.</p>\n<p>For these reasons, cemeteries adopt regulations for the <b><i>common good</i></b>. To be effective, it is sometimes necessary to take steps to uniformly enforce the regulations.</p>\n<p>Cemetery offices maintain burial records to assist families in locating graves for the placement of floral tributes. Cemetery rules typically stipulate what decorations are acceptable. During the growing season, fresh/live flowers are encouraged; seasonal artificial flowers are permitted. Cemetery superintendents cannot contact individual families if decorations are not in keeping with cemetery regulations. For families unable to visit graves, tributes are accepted from local florists and assistance with placement may be offered.</p>\n',	'Visits & Decorations',	'',	'inherit',	'closed',	'closed',	'',	'592-revision-v1',	'',	'',	'2018-04-16 12:12:46',	'2018-04-16 16:12:46',	'',	592,	'https://rosehillmemorialpark.com/592-revision-v1/',	0,	'revision',	'',	0),
