(614,	1,	'2018-05-03 12:08:07',	'2018-05-03 16:08:07',	'\n	<p>Rose Hill Memorial Park is divided into 32 sections which include full burial and cremation burial. Section 11 is our \"Pathway of Heroes\" specifically to honor fallen veterans. Please contact us to discuss your burial needs or if you need assistance locating the grave of a loved one.</p>\n',	'Rose Hill Map',	'',	'inherit',	'closed',	'closed',	'',	'539-revision-v1',	'',	'',	'2018-05-03 12:08:07',	'2018-05-03 16:08:07',	'',	539,	'https://rosehillmemorialpark.com/539-revision-v1/',	0,	'revision',	'',	0),
(615,	1,	'2018-05-03 12:20:30',	'2018-05-03 16:20:30',	'\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/ground-burial.jpg\" alt=\"Ground Burial\" itemprop=\"image\" height=\"540\" width=\"720\"  />\n		<h3>Full Burial</h3>		\n			<p>Ground burial is offered in various sections at Rose Hill Memorial Park.  Please contact us regarding sections available for pre-planning and immediate need. Inquiry about specific locations is best made by family members at the cemetery office.</p>\n		<h3>Cremation Burial</h3>		\n			<p>Rose Hill Memorial Park offers a variety of options for the respectful disposition and memorialization of cremated remains.  Please inquire with our office for specific information.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/cremated-remains-burial.jpg\" alt=\"Burial of cremated remains\" itemprop=\"image\" height=\"540\" width=\"720\"  />\n',	'Services',	'',	'inherit',	'closed',	'closed',	'',	'158-revision-v1',	'',	'',	'2018-05-03 12:20:30',	'2018-05-03 16:20:30',	'',	158,	'https://rosehillmemorialpark.com/158-revision-v1/',	0,	'revision',	'',	0),
