(592,	1,	'2018-04-16 11:53:56',	'2018-04-16 15:53:56',	'<!-- wp:fl-builder/layout -->\n	<p><img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/08/rose-hill-cemetary.jpg\" alt=\"Rose Hill Cemetary\" width=\"543\" height=\"387\" />Rose Hill is a place of remembrance and respect. We strive to keep a beautiful, park like atmosphere and encourage visits from family and friends.  We honor the custom of expressing love and devotion by decorating graves where loved ones are buried. Common practice is to adorn burial spaces with flowers. Decorating, however, must be done in a way that does not create a safety hazard, impede proper maintenance, infringe on other graves, diminish the character of the cemetery, or offend others.</p>\n<p>For these reasons, cemeteries adopt regulations for the <b><i>common good</i></b>. To be effective, it is sometimes necessary to take steps to uniformly enforce the regulations.</p>\n<p>Cemetery offices maintain burial records to assist families in locating graves for the placement of floral tributes. Cemetery rules typically stipulate what decorations are acceptable. During the growing season, fresh/live flowers are encouraged; seasonal artificial flowers are permitted. Cemetery superintendents cannot contact individual families if decorations are not in keeping with cemetery regulations. For families unable to visit graves, tributes are accepted from local florists and assistance with placement may be offered.</p>\n	<h3>Rules and Regulations Concerning Grave Tributes</h3>\n<ul>\n<li>One 12\'\" size pot will be allowed per grave.</li>\n<li>Pot must conform to cemetery policy - plastic, green, with removable handle (can be obtained in our administration office).</li>\n<li>You may place anything you wish in the pot (plants, stones, statutes, flags, other memorabilia).</li>\n<li>Nothing will be allowed to be placed outside the planter.</li>\n<li>Only natural plants are allowed from March 15 to November 15.</li>\n<li>Artificial Flowers or wreaths may only be placed from November 15 to March 15.</li>\n<li>Unsightly or nonconforming items will be removed by staff at their discretion.</li>\n<li>Neither Rose Hill Memorial Park nor any Rose Hill entity employees will be responsible for theft, damage or destruction of grave tributes.</li>\n</ul>\n<!-- /wp:fl-builder/layout -->',	'Visits & Decorations',	'',	'publish',	'closed',	'closed',	'',	'visits-decorations',	'',	'',	'2019-05-17 11:29:42',	'2019-05-17 15:29:42',	'',	0,	'https://rosehillmemorialpark.com/?page_id=592',	0,	'page',	'',	0),
