(594,	1,	'2018-04-16 11:58:19',	'2018-04-16 15:58:19',	'\n	<p>Rose Hill is a place of remembrance and respect. We strive to keep a beautiful, park like atmosphere which encourage visits of fa mily and freinds.  We honor the custom of expressing love and devotion by decorating graves where loved ones are buried. Common practice is to adorn burial spaces with flowers. Decorating, however, must be done in a way that does not create a safety hazard, impede proper maintenance, infringe on other graves, diminish the character of the cemetery, or offend others.</p>\n<p>For these reasons, cemeteries adopt regulations for the <b><i>common good</i></b>. To be effective, it is sometimes necessary to take steps to uniformly enforce the regulations.</p>\n<p>Cemetery offices maintain burial records to assist families in locating graves for the placement of floral tributes. Cemetery rules typically stipulate what decorations are acceptable. During the growing season, fresh/live flowers are encouraged; seasonal artificial flowers are permitted. Cemetery superintendents cannot contact individual families if decorations are not in keeping with cemetery regulations. For families unable to visit graves, tributes are accepted from local florists and assistance with placement may be offered.</p>\n',	'Visits & Decorations',	'',	'inherit',	'closed',	'closed',	'',	'592-revision-v1',	'',	'',	'2018-04-16 11:58:19',	'2018-04-16 15:58:19',	'',	592,	'https://rosehillmemorialpark.com/592-revision-v1/',	0,	'revision',	'',	0),
(515,	1,	'2018-04-09 14:11:15',	'2018-04-09 18:11:15',	'\n	<h1></h1>\n<p>We are happy to answer any and all questions about funerals, burial, cremation, and funeral preparations which come our way – and we hear some over and over again. Those are the ones we’ve included in this section of the website.</p>\n<p>However, if you’re question isn’t listed, don’t hesitate to email us. If yours is an urgent need, please call.</p>\n<table border=\"0\">\n<tbody>\n<tr>\n<td align=\"right\" valign=\"top\">1. </td>\n<td align=\"left\" valign=\"top\">What is a funeral?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">2. </td>\n<td align=\"left\" valign=\"top\">How much does a funeral cost?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">3. </td>\n<td align=\"left\" valign=\"top\">How do I make funeral arrangements?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">4. </td>\n<td align=\"left\" valign=\"top\">What is a pre-arranged funeral?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">5. </td>\n<td align=\"left\" valign=\"top\">How do I make funeral arrangements?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">6. </td>\n<td align=\"left\" valign=\"top\">What type of funeral service should I have?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">7. </td>\n<td align=\"left\" valign=\"top\">Can I personalize my funeral service?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">8. </td>\n<td align=\"left\" valign=\"top\">Why should we have a public viewing?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">9. </td>\n<td align=\"left\" valign=\"top\">What should I do if a death occurs in the middle of the night or on the weekend?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">10. </td>\n<td align=\"left\" valign=\"top\">What should I do if a death occurs while away from home?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">11. </td>\n<td align=\"left\" valign=\"top\">What happens if I have a problem with how a funeral was handled?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">12. </td>\n<td align=\"left\" valign=\"top\">Why do we need an obituary notice?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">13. </td>\n<td align=\"left\" valign=\"top\">What is included in an obituary?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">14. </td>\n<td align=\"left\" valign=\"top\">What is embalming?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">15. </td>\n<td align=\"left\" valign=\"top\">Is embalming necessary?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">16. </td>\n<td align=\"left\" valign=\"top\">What is involved in cremation?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">17. </td>\n<td align=\"left\" valign=\"top\">Do I need a casket if I choosecremation?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">18. </td>\n<td align=\"left\" valign=\"top\">Can I have a visitation period and a funeral service if cremation is chosen?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">19. </td>\n<td align=\"left\" valign=\"top\">What can be done with the cremated remains?<br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"></td>\n</tr>\