(514,	1,	'2018-04-09 14:07:24',	'2018-04-09 18:07:24',	'\n	<h1></h1>\n<p>We are happy to answer any and all questions about funerals, burial, cremation, and funeral preparations which come our way – and we hear some over and over again. Those are the ones we’ve included in this section of the website.</p>\n<p>However, if you’re question isn’t listed, don’t hesitate to email us. If yours is an urgent need, please <a href=\"http://www.kuhnfuneralhomes.com/Contact-Us.html\">call</a>.</p>\n<table border=\"0\">\n<tbody>\n<tr>\n<td align=\"right\" valign=\"top\">1. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433913\">What is a funeral?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">2. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433914\">How much does a funeral cost?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">3. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433915\">How do I make funeral arrangements?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">4. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433916\">What is a pre-arranged funeral?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">5. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433917\">How do I make funeral arrangements?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">6. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433918\">What type of funeral service should I have?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">7. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433919\">Can I personalize my funeral service?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">8. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433920\">Why should we have a public viewing?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">9. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433921\">What should I do if a death occurs in the middle of the night or on the weekend?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">10. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433922\">What should I do if a death occurs while away from home?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">11. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433923\">What happens if I have a problem with how a funeral was handled?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">12. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433924\">Why do we need an obituary notice?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">13. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433925\">What is included in an obituary?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">14. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433926\">What is embalming?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">15. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433927\">Is embalming necessary?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">16. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433928\">What is involved in cremation?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">17. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433929\">Do I need a casket if I choose cremation?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">18. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433930\">Can I have a visitation period and a funeral service if cremation is chosen?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"> </td>\n</tr>\n<tr>\n<td align=\"right\" valign=\"top\">19. </td>\n<td align=\"left\" valign=\"top\"><a href=\"http://www.kuhnfuneralhomes.com/Frequently-Asked-Questions.html#f433931\">What can be done with the cremated remains?</a><br />\n</td>\n</tr>\n<tr>\n<td colspan=\"2\"></td>\n</tr>\n</tbody>\n</table>\n',	'Frequently Asked Questions (FAQ)',	'',	'inherit',	'closed',	'closed',	'',	'235-revision-v1',	'',	'',	'2018-04-09 14:07:24',	'2018-04-09 18:07:24',	'',	235,	'https://rosehillmemorialpark.com/235-revision-v1/',	0,	'revision',	'',	0),
(517,	2,	'2018-04-10 08:01:02',	'2018-04-10 12:01:02',	'\n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-3.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"719\" width=\"1080\"  />\n				</a>\n<h3><a href=\"#\" target=\"_self\">Rose Hill Memorial Park</a></h3>		\n			<p>Whatever your company is most known for should go right here, whether that\'s bratwurst or baseball caps or vampire bat removal.</p>\n<a href=\"#\" target=\"_self\">Learn More</a>		 \n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-2.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"719\" width=\"1080\"  />\n				</a>\n<h3><a href=\"#\" target=\"_self\">Welcome</a></h3>		\n			<p>What\'s another popular item you have for sale or trade? Talk about it here in glowing, memorable terms so site visitors have to have it.</p>\n<a href=\"#\" target=\"_self\">Learn More</a>		 \n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-1.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"719\" width=\"1080\"  />\n				</a>\n<h3><a href=\"#\" target=\"_self\">Memorial Park Info</a></h3>		\n			<p>Don\'t think of this product or service as your third favorite, think of it as the bronze medalist in an Olympic medals sweep of great products/services.</p>\n<a href=\"#\" target=\"_self\">Learn More</a>		 \n	<h3>Your Main Message</h3>\n<p>Use this space to tell people what your company does and why and how it does it. What\'re you known for? Who likes you? What\'s your number one competitive advantage?</p>\n<p>Include all the things that make your business unique and better than the competition. Do you have a patented 13-step process for taxidermy that results in the most lifelike stuffed owls? You gotta mention that.</p>\n<p>Other good things to weave into this copy include: awards won, distinctions given, number of products sold, company philosophy (just keep it short), interesting company history bits, and anything that makes a reader think you\'d be awesome to do business with.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-4.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"1188\" width=\"948\"  />\n		<h3>Next Steps...</h3>\n		<p>This is should be a prospective customer\'s number one call to action, e.g., requesting a quote or perusing your product catalog.</p>\n			<a href=\"\" target=\"_self\" role=\"button\">\n							Call to Action\n					</a>\n',	'Home',	'',	'inherit',	'closed',	'closed',	'',	'156-revision-v1',	'',	'',	'2018-04-10 08:01:02',	'2018-04-10 12:01:02',	'',	156,	'https://rosehillmemorialpark.com/156-revision-v1/',	0,	'revision',	'',	0),
(621,	1,	'2018-05-03 12:37:59',	'2018-05-03 16:37:59',	'\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/ground-burial.jpg\" alt=\"Ground Burial\" itemprop=\"image\" height=\"540\" width=\"720\"  />\n		<h3>Full Burial</h3>		\n			<p>Ground burial is offered in various sections at Rose Hill Memorial Park.  Please contact us regarding sections available for pre-planning and immediate need. Inquiry about specific locations is best made by family members at the cemetery office.</p>\n<p>Section 32 is our current full burial section with lots available.<br />\n<a href=\"https://rosehillmemorialpark.com/rose-hill-map/\">See map</a>.</p>\n		<h3>Cremation Burial</h3>		\n			<p>Rose Hill Memorial Park offers a variety of options for the respectful disposition and memorialization of cremated remains.  Please inquire with our office for specific information.</p>\n<p>Section 16-B is our current cremation section with lots only available for cremains. This is a new section that was recently opened.</p>\n<p><a href=\"https://rosehillmemorialpark.com/rose-hill-map/\">See map</a>.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/cremated-remains-burial.jpg\" alt=\"Burial of cremated remains\" itemprop=\"image\" height=\"540\" width=\"720\"  />\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/cremated-remains-burial.jpg\" alt=\"Burial of cremated remains\" itemprop=\"image\" height=\"540\" width=\"720\"  />\n		<h3>Crypt Burial</h3>		\n			<p>Section 23-C is our crypt section, which are double depth lots with two full burial spaces in the same gravesite. There is limited space in this section.</p>\n<p><a href=\"https://rosehillmemorialpark.com/rose-hill-map/\">See map</a>.</p>\n',	'Services',	'',	'inherit',	'closed',	'closed',	'',	'158-revision-v1',	'',	'',	'2018-05-03 12:37:59',	'2018-05-03 16:37:59',	'',	158,	'https://rosehillmemorialpark.com/158-revision-v1/',	0,	'revision',	'',	0),
(622,	1,	'2018-05-03 12:38:34',	'2018-05-03 16:38:34',	'\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/ground-burial.jpg\" alt=\"Ground Burial\" itemprop=\"image\" height=\"540\" width=\"720\"  />\n		<h3>Full Burial</h3>		\n			<p>Ground burial is offered in various sections at Rose Hill Memorial Park.  Please contact us regarding sections available for pre-planning and immediate need. Inquiry about specific locations is best made by family members at the cemetery office.</p>\n<p>Section 32 is our current full burial section with lots available.<br />\n<a href=\"https://rosehillmemorialpark.com/rose-hill-map/\">See map</a>.</p>\n		<h3>Cremation Burial</h3>		\n			<p>Rose Hill Memorial Park offers a variety of options for the respectful disposition and memorialization of cremated remains.  Please inquire with our office for specific information.</p>\n<p>Section 16-B is our current cremation section with lots only available for cremains. This is a new section that was recently opened.</p>\n<p><a href=\"https://rosehillmemorialpark.com/rose-hill-map/\">See map</a>.</p>\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/cremated-remains-burial.jpg\" alt=\"Burial of cremated remains\" itemprop=\"image\" height=\"540\" width=\"720\"  />\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/ground-burial.jpg\" alt=\"Ground Burial\" itemprop=\"image\" height=\"540\" width=\"720\"  />\n		<h3>Crypt Burial</h3>		\n			<p>Section 23-C is our crypt section, which are double depth lots with two full burial spaces in the same gravesite. There is limited space in this section.</p>\n<p><a href=\"https://rosehillmemorialpark.com/rose-hill-map/\">See map</a>.</p>\n',	'Services',	'',	'inherit',	'closed',	'closed',	'',	'158-revision-v1',	'',	'',	'2018-05-03 12:38:34',	'2018-05-03 16:38:34',	'',	158,	'https://rosehillmemorialpark.com/158-revision-v1/',	0,	'revision',	'',	0),
(625,	1,	'2018-05-03 13:18:59',	'2018-05-03 17:18:59',	'\n	<h3>What can you leave on a loved one’s gravesite when visiting?</h3>\n<p>We allow one flower basket per gravesite. This basket is provided by us in office, but you are allowed to use your own as long as it’s 12” maximum, green, plastic, and with a handle. Everything that you would place on the gravesites (flowers, stones, statues, and flags) have to be inside this basket.</p>\n<h3>When will the balsam blankets be placed by?</h3>\n<p>Balsam Blankets start to be placed at the end of November and are continually placed throughout the season. We do not guarantee that they will be placed until a week before Christmas.</p>\n<h3>How many burials can you have in one plot?</h3>\n<p>In one full burial lot, you can have one full burial and one cremation burial or two cremation burials. In a cremation lot, you can only have one person’s cremains buried.</p>\n<h3>What can you do with your vacant plot that will not be used?</h3>\n<p>You can transfer the certificate title into another person’s name (for a fee). You can do this is you find a buyer for your plot or if you would like to give the plot to someone. Rose Hill also accept lots donated back to Rose Hill.</p>\n<h3>Does Rose Hill purchase plots back?</h3>\n<p>Rose Hill cannot purchase lots from any individual, we can only take them as a donation.</p>\n<h3>Are there spaces available at Rose Hill?</h3>\n<p>There is plenty of space left at Rose Hill that currently have lots available. Please contact the office for inquiries about these available plots.</p>\n<h3>How much notice do we need to set up a burial of cremains?</h3>\n<p>A week ahead burial would be preferred, but we can schedule a burial with only a 3 day notice.<br />\n&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong> </strong></p>\n',	'Frequently Asked Questions (FAQ)',	'',	'inherit',	'closed',	'closed',	'',	'235-revision-v1',	'',	'',	'2018-05-03 13:18:59',	'2018-05-03 17:18:59',	'',	235,	'https://rosehillmemorialpark.com/235-revision-v1/',	0,	'revision',	'',	0),
