(623,	1,	'2018-05-03 12:43:13',	'2018-05-03 16:43:13',	'\n	<p><strong>What can you leave on a loved one’s gravesite when visiting?</strong></p>\n<blockquote><p>We allow one flower basket per gravesite. This basket is provided by us in office, but you are allowed to use your own as long as it’s 12” maximum, green, plastic, and with a handle. Everything that you would place on the gravesites (flowers, stones, statues, and flags) have to be inside this basket.</p></blockquote>\n<p><strong>When will the balsam blankets be placed by?</strong></p>\n<blockquote><p>Balsam Blankets start to be placed at the end of November and are continually placed throughout the season. We do not guarantee that they will be placed until a week before Christmas.</p></blockquote>\n<p><strong>How many burials can you have in one plot?</strong></p>\n<blockquote><p>In one full burial lot, you can have one full burial and one cremation burial or two cremation burials. In a cremation lot, you can only have one person’s cremains buried.</p></blockquote>\n<p><strong>What can you do with your vacant plot that will not be used?</strong></p>\n<blockquote><p>You can transfer the certificate title into another person’s name (for a fee). You can do this is you find a buyer for your plot or if you would like to give the plot to someone. Rose Hill also accept lots donated back to Rose Hill.</p></blockquote>\n<p><strong>Does Rose Hill purchase plots back?</strong></p>\n<blockquote><p>Rose Hill cannot purchase lots from any individual, we can only take them as a donation.</p></blockquote>\n<p><strong>Are there spaces available at Rose Hill?</strong></p>\n<blockquote><p>There is plenty of space left at Rose Hill that currently have lots available. Please contact the office for inquiries about these available plots.</p></blockquote>\n<p><strong>How much notice do we need to set up a burial of cremains?</strong></p>\n<blockquote><p>A week ahead burial would be preferred, but we can schedule a burial with only a 3 day notice.</p></blockquote>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong> </strong></p>\n',	'Frequently Asked Questions (FAQ)',	'',	'inherit',	'closed',	'closed',	'',	'235-revision-v1',	'',	'',	'2018-05-03 12:43:13',	'2018-05-03 16:43:13',	'',	235,	'https://rosehillmemorialpark.com/235-revision-v1/',	0,	'revision',	'',	0),
(626,	1,	'2018-05-03 13:30:19',	'2018-05-03 17:30:19',	'\n	<h3>What can you leave on a loved one’s gravesite when visiting?</h3>\n<p>We allow one flower basket per gravesite. This basket is provided by us in office, but you are allowed to use your own as long as it’s 12” maximum, green, plastic, and with a handle. Everything that you would place on the gravesites (flowers, stones, statues, and flags) has to be inside this basket.</p>\n<h3>When are the balsam blankets placed?</h3>\n<p>Balsam blankets start to be placed at the end of November and are continually placed throughout the season. We do not guarantee that they will be placed until a week before Christmas.</p>\n<h3>How many burials can you have in one plot?</h3>\n<p>In one full burial lot, you can have one full burial and one cremation burial or two cremation burials. In a cremation lot, you can only have one person’s cremains buried.</p>\n<h3>What can you do with your vacant plot that will not be used?</h3>\n<p>You can transfer the certificate title into another person’s name (for a fee). You can do this if you find a buyer for your plot or if you would like to give the plot to someone. Rose Hill also accept lots donated back to Rose Hill.</p>\n<h3>Does Rose Hill purchase plots back?</h3>\n<p>Rose Hill cannot purchase lots from any individual, we can only take them as a donation.</p>\n<h3>Are there spaces available at Rose Hill?</h3>\n<p>There is plenty of space left at Rose Hill and we currently have lots available. Please contact the office for inquiries about these available plots.</p>\n<h3>How much notice do we need to set up a burial of cremains?</h3>\n<p>A week ahead burial would be preferred, but we can schedule a burial with only a 3 day notice.<br />\n&nbsp;</p>\n<p><strong> </strong></p>\n',	'Frequently Asked Questions (FAQ)',	'',	'inherit',	'closed',	'closed',	'',	'235-revision-v1',	'',	'',	'2018-05-03 13:30:19',	'2018-05-03 17:30:19',	'',	235,	'https://rosehillmemorialpark.com/235-revision-v1/',	0,	'revision',	'',	0),
(627,	1,	'2018-05-09 14:02:19',	'2018-05-09 18:02:19',	'\n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-3.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"719\" width=\"1080\"  />\n				</a>\n<h3><a href=\"#\" target=\"_self\">Rose Hill Memorial Park</a></h3>		\n			<p>Rose Hill Cemetery provides a peaceful park-like landscape with large trees spread throughout. The cemetery is over XXX acres with easy access to it\'s many sections by both vehicle and foot.</p>\n<a href=\"#\" target=\"_self\">Learn More</a>		 \n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-2.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"719\" width=\"1080\"  />\n				</a>\n<h3><a href=\"#\" target=\"_self\">Hours</a></h3>		\n			<p>The Rose Hill Memorial Park hours are from 7:30 a.m. to sunset.</p>\n<a href=\"#\" target=\"_self\">Learn More</a>		 \n				<a href=\"#\" target=\"_self\" itemprop=\"url\">\n				<img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/03/rose-hill-memorial-park-1.jpg\" alt=\"Rose Hill Memorial Park\" itemprop=\"image\" height=\"719\" width=\"1080\"  />\n				</a>\n<h3><a href=\"#\" target=\"_self\">Cemetery Clean-up Dates</a></h3>		\n			<p>All winter decorations must be removed by mid-March. New decorations may be placed after May 15. Fall cleanup is mid-October. Holiday decorations may be placed after Thanksgiving.</p>\n<a href=\"#\" target=\"_self\">Learn More</a>		 \n	<p>In an effort to preserve the integrity of the purpose that everyone in the cemetery is equal, bronze memorials are the only memorials allowed at Rose Hill Memorial Park. The cemetery was designed to emulate a park like atmosphere that allows the living to embrace it and spend quality time in it, allowing for the memories of our loved ones to live on in our hearts forever.</p>\n	<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/-5_UmxnrCFU?rel=0&amp;showinfo=0\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>\n',	'Home',	'',	'inherit',	'closed',	'closed',	'',	'156-revision-v1',	'',	'',	'2018-05-09 14:02:19',	'2018-05-09 18:02:19',	'',	156,	'https://rosehillmemorialpark.com/156-revision-v1/',	0,	'revision',	'',	0),
(639,	1,	'2018-05-31 15:45:27',	'2018-05-31 19:45:27',	'\n	<p><img src=\"https://rosehillmemorialpark.com/wp-content/uploads/2018/04/rose-hill-memorial-park1-1024x768.jpg\" alt=\"Rose Hill Memorial Park\" width=\"518\" height=\"381\" />Rose Hill is a place of remembrance and respect. We strive to keep a beautiful, park like atmosphere and encourage visits from family and friends.  We honor the custom of expressing love and devotion by decorating graves where loved ones are buried. Common practice is to adorn burial spaces with flowers. Decorating, however, must be done in a way that does not create a safety hazard, impede proper maintenance, infringe on other graves, diminish the character of the cemetery, or offend others.</p>\n<p>For these reasons, cemeteries adopt regulations for the <b><i>common good</i></b>. To be effective, it is sometimes necessary to take steps to uniformly enforce the regulations.</p>\n<p>Cemetery offices maintain burial records to assist families in locating graves for the placement of floral tributes. Cemetery rules typically stipulate what decorations are acceptable. During the growing season, fresh/live flowers are encouraged; seasonal artificial flowers are permitted. Cemetery superintendents cannot contact individual families if decorations are not in keeping with cemetery regulations. For families unable to visit graves, tributes are accepted from local florists and assistance with placement may be offered.</p>\n	<h3>Rules and Regulations Concerning Grave Tributes</h3>\n<ul>\n<li>One 12\'\" size pot will be allowed per grave.</li>\n<li>Pot must conform to cemetery policy - plastic, green, with removable handle (can be purchased at cost in our administration office).</li>\n<li>You may place anything you wish in the pot (plants, stones, statutes, flags, other memorabilia).</li>\n<li>Nothing will be allowed to be placed outside the planter.</li>\n<li>Only natural plants are allowed from March 15 to November 15.</li>\n<li>Artificial Flowers or wreaths may only be placed from November 15 to March 15.</li>\n<li>Unsightly or nonconforming items will be removed by staff at their discretion.</li>\n<li>Neither Rose Hill Memorial Park nor any Rose Hill entity employees will be responsible for theft, damage or destruction of grave tributes.</li>\n</ul>\n',	'Visits & Decorations',	'',	'inherit',	'closed',	'closed',	'',	'592-revision-v1',	'',	'',	'2018-05-31 15:45:27',	'2018-05-31 19:45:27',	'',	592,	'https://rosehillmemorialpark.com/592-revision-v1/',	0,	'revision',	'',	0),
(640,	1,	'2018-05-31 16:09:08',	'2018-05-31 20:09:08',	'\n	<p>The board of trustees has been working very hard the past five years to make Rose Hill Memorial Park a beautiful, safe, and peaceful cemetery. We have replaced fencing, begun paving roads, refurbished our maintenance garages, purchased new and much needed equipment, refurbished the exterior of the chapel, created an outdoor chapel, removed many dead trees, refurbished the front entrance and original fountain, build a customer friendly watering station, and moved all of our accounting records to computerization.</p>\n<p>We are currently in the process of developing a website and creating a database of all of our loved ones graves. Please let us know how we were doing below.</p>\n<p></p>\nPowered by<img src=\"//assets.emailmeform.com/images/footer-logo.png?RU1GLTAyLTM0\" />EMF <a href=\"http://www.emailmeform.com/survey.html\" target=\"_blank\" rel=\"noopener\">Online Survey</a>\n',	'Feedback',	'',	'publish',	'closed',	'closed',	'',	'feedback',	'',	'',	'2018-05-31 16:43:33',	'2018-05-31 20:43:33',	'',	0,	'https://rosehillmemorialpark.com/?page_id=640',	0,	'page',	'',	0),
