eaths may only be placed from November 15 to March 15.</li>\n<li>Unsightly or nonconforming items will be removed by staff at their discretion.</li>\n<li>Neither Rose Hill Memorial Park nor any Rose Hill entity employees will be responsible for theft, damage or destruction of grave tributes.</li>\n</ul>\n',	'Visits & Decorations',	'',	'inherit',	'closed',	'closed',	'',	'592-revision-v1',	'',	'',	'2018-06-01 10:53:07',	'2018-06-01 14:53:07',	'',	592,	'https://rosehillmemorialpark.com/592-revision-v1/',	0,	'revision',	'',	0),
